import React from 'react';
import Aside from '../src/Components/UI/Aside';
import './App.css';
import Router from './Components/Routes/Router';

function App() {
  const front = {
    title: 'teste'
  }

  const back = {
    title: 'teste-back'
  }

  return (
    <div className="App">
      <Aside />
      <Switch>
        <Router />
      </Switch>
    </div>
  );
}

export default App;
